  margin-bottom: 25px;
  color: #fec107;
  text-align: center;
`

const Title = styled.h1`
  font-size: 30px;
  color: #ffd658;
  padding: 10px 0;
`

const Packagetype = styled.div`
  color: #757575;
  font-size: 18px;
  padding: 10px 0;
`

const Watchnum = styled.div`
  font-size: 18px;
  font-weight: bold;
  padding: 10px 0;
`

const Marketprice = styled.div`
  color: #6d757a;
  font-size: 18px;
  font-weight: light;
  padding: 10px 0;
  text-decoration: line-through;
`

const Realprice = styled.div`
  font-size: 24px;
  font-weight: light;
  color: #fec107;
  padding: 10px 0;
`

const Desc = styled.div`
  font-size: 18px;
  font-weight: light;
  padding: 10px 0;
`

const Header = (props) => {
  debugger
  const {stock_code} = props.attributes

  return (
    <Wrapper>
      <Title>{stock_code}</Title>
      <div>

      </div>
    </Wrapper>
  )
}

export default Header
